.
Compote recipe
.
2 cups fresh sliced strawberries (frozen can be used as well) 
2 cups blueberries (fresh or frozen)
1 tsp. Xanthan gum 
3/4 cup confectionery swerve sugar

Add fruit and Xanthan gum to a pot. Allow it to come to a boil. Don’t let the fruit over boil.. you want the berries to be a little firm and still have their shape, not mushy. Simmer on low and gently pour in the swerve sugar. Allow to simmer on medium mixing all ingredients together and allowing it to thicken. 
.
.
That’s it 😀... cool and add this deliciousness to pancakes, yogurt, cottage cheese, cream cheese sandwich, waffles, ice cream, and the list goes on!!! Enjoy 😉 
.
