I have been seeing  all my girls making this and I have been dying to try. So of course I had to use the best pre made, keto friendly crust on the market! From no other than @unbunfoods 

So I preheated my oven to 400° and popped just the crust in for about 8 mins to crisp it up a bit. 

For the sauce I mixed together fresh garlic, cream cheese , s&p, dill and a splash of cream. . Spread that over the crust and sprinkled with a little more dill. Then added a tiny bit of mozzarella then the sliced pickles and a little more mozza. Popped it back in the oven until bubbly and voilaa! Easy, peasey, lemon squeezy 😉😉 

Guys it's so good! A must try !!! 

Thank u to @ketowithmyboys @the.brainy.gal for the inspo. 

Also a huge thank u too @unbunfoods for sending me these crusts to try. You guys are amazing and I appreciate you so much. 💕🍕🥰

